import Button from 'react-bootstrap/Button';
import { BsPlusLg, BsAppIndicator, BsSearch } from "react-icons/bs";
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Navbar from 'react-bootstrap/Navbar';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import Dropdown from 'react-bootstrap/Dropdown';
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';


    // position: sticky;top: 0
    // <BsPlusLg /> Add Products 
    // AiOutlineSearch
function Header() {
    const options = [
        'one', 'two', 'three'
        ]
    // const defaultOption = options[0];

    return (
        <>     
            <Navbar bg="light" expand="lg">
                <Container fluid>
                    <Row className='w-100'>
                    <Col xs={5}>
                        <h2> Web Cunsultancy </h2>
                    </Col>
                    <Col xs={2}>
                        <Dropdown options={options} onChange={this}  placeholder="Select an option" />
                        <Dropdown.Divider />
                    </Col>
                    <Col className="offset-xs-3">
                        <Navbar.Collapse id="navbarScroll">
                            <Navbar.Brand href="#">hg</Navbar.Brand>
                            <Form className="d-flex nav navbar-nav navbar-right">
                                <Form.Control
                                    type="search"
                                    placeholder= "search"
                                    className="me-2"
                                    aria-label="Search"
                                />
                            </Form>
                            <div style = {{ fontSize: 'larger' }}>
                                <BsSearch />
                            </div>
                        </Navbar.Collapse>
                    </Col>
                    </Row>
                </Container>
            </Navbar>
        </>
    );
}

export default Header;
